import React from "react";
import ReactDOM from 'react-dom';
import Cards from "./Cards";
import "./index.css"
import Sdata from "./Sdata";


ReactDOM.render(
    <>
      <h1 className="heading_style">List of top 5 Netflix series in 2023</h1>

    <Cards 
        imgsrc= {Sdata[0].imgscr}
        title= {Sdata[0].title}
        sname= {Sdata[0].sname}
        link= {Sdata[0].links}
    />
    <Cards 
        imgsrc= {Sdata[1].imgscr}
        title= {Sdata[1].title}
        sname= {Sdata[1].sname}
        link= {Sdata[1].links}
    />
    <Cards 
        imgsrc= {Sdata[2].imgscr}
        title= {Sdata[2].title}
        sname= {Sdata[2].sname}
        link= {Sdata[2].links}
    />
    <Cards 
        imgsrc= {Sdata[3].imgscr}
        title= {Sdata[3].title}
        sname= {Sdata[3].sname}
        link= {Sdata[3].links}
    />
    <Cards 
        imgsrc= {Sdata[4].imgscr}
        title= {Sdata[4].title}
        sname= {Sdata[4].sname}
        link= {Sdata[4].links}
    />
     <Cards 
        imgsrc= {Sdata[5].imgscr}
        title= {Sdata[5].title}
        sname= {Sdata[5].sname}
        link= {Sdata[5].links}
    />



    </>,


    document.getElementById("root")
);
